import React from "react";
import StampIcon from "../Assets/stamp-icon.png";

function StampSubmit({ onSubmit, isActive }) {
  return (
    <div className="stamp-div">
      <button className="submit-button" onClick={onSubmit} disabled={!isActive}>
        <img scr={StampIcon} className="stamp-icon" alt="Stamp Icon" />
        Stamp Cut Sheets
      </button>
    </div>
  );
}

export default StampSubmit;
